import React from "react";
import { Link } from "react-router-dom";
import Brandname from "./Brandname";

const Loginbox = () => {
  return (
    <div>
      <div>
        <Brandname />
      </div>
      <div>
        <Link to="/signup">Sign up</Link>
      </div>
    </div>
  );
};

export default Loginbox;
